    "name": "Altus",
    "overview": "##### Project general facts\n\nAltus by Emaar offers a diverse selection of city-inspired residences. The 1-bedroom units, perfect for individuals or couples, provide expansive living spaces and stunning city views. The 2 and 3-bedroom suites elevate the luxury experience, featuring modern bathrooms, spacious closets, and panoramic balconies that create spaces truly at the heart of urban living.\n\nArchitectural elements such as balconies, horizontal ledges, and tinted window glass minimize direct sunlight intrusion, ensuring cooler interiors. Emphasis is placed on retaining existing vegetation for sustainability, reducing energy use, and enhancing environmental quality. The design of Altus reflects a commitment to both aesthetic appeal and environmental responsibility.\n\nAltus promotes efficient water use through innovative measures such as condensate and planter drain collection for landscape irrigation. These sustainable practices highlight the project’s dedication to ecological balance while offering residents an elegant and comfortable living environment. Altus by Emaar represents a harmonious blend of luxury, functionality, and sustainability in the heart of the city.\n\n##### Finishing and materials\n\nFully finished using high quality materials.\n\n##### Kitchen and appliances\n\nEquipped kitchen.\n\n##### Furnishing\n\nNo.\n\n##### Location description and benefits\n\nDubai Creek Harbour - heart of bold new vision for Dubai. The eight square kilometre waterfront destination is bound to push the frontiers of architecture, design and the quality of life. Creek Beach is Dubai’s first-of-its-kind urban beach in the heart of Dubai Creek Harbour. Located along the historic Dubai Creek. \n\nCreek Beach is conceived to offered you the ultimate family-friendly retreat. From 700 metres of pristine white sands to the infinity pool and spectacular sunset views, this is paradise reborn. The centerpiece of Dubai Creek Harbour is the breathtaking Dubai Creek Tower, set to surpass the Burj Khalifa as the tallest structure globally. This architectural marvel is designed by the renowned architect Santiago Calatrava and will serve as a symbol of Dubai's ambition and innovation.\n\nDubai Creek Harbour represents a bold vision for the future of Dubai, blending cutting-edge design, sustainability, and cultural richness to create a dynamic and iconic waterfront destination. It not only serves as a testament to Dubai's commitment to innovation but also as a symbol of its ambition to create world-class living spaces.\n",
